import React from "react";

const Services = () => {
    const services = [
        {
            id: 1,
            name: "Equine portraiture",
            txt: "Equine portraiture is a beautiful and timeless way to capture the spirit and beauty of your horse. Whether you are a competitive rider or simply a horse lover, an equine portrait is a wonderful way to celebrate your equine partner.",
            img: "/assets/Equineportraiture.jpg"
        },
        {
            id: 2,
            name: "Event photography",
            txt: "Event photography is a specialized type of photography that captures the essence of an event through images. Whether it's a small private gathering or a large public event, event photography requires skill and experience to capture the best moments and emotions of the occasion",
            img: "/assets/Eventphotography.jpg"
        },

    ]
	return (
		<div>
			<h1>Services</h1>
			{/* eventually put in to something that I can loop over */}
			<div class="album py-5 highlight-color">
				<div class="container">
					<div class="row row-cols-1 row-cols-sm-2 row-cols-md-3 g-3">
                        {
                            services.length > 0 ? (
                                <div className="col">
							<div className="card shadow-sm">
								<img
									src="/assets/Equineportraiture.jpg"
									className="card-img-top"
									alt="..."
								/>
								<div className="card-body">
									<h5 className="card-title">Equine portraiture</h5>
									<p className="card-text">
                                    Equine portraiture is a beautiful and timeless way to capture the spirit and beauty of your horse. Whether you are a competitive rider or simply a horse lover, an equine portrait is a wonderful way to celebrate your equine partner.
									</p>
								</div>
							</div>
						</div>
                            ):{
                                
                            }
                        }
						
					</div>
				</div>
			</div>
		</div>
	);
};

export default Services;
